export const languages_ver = {
    javascript: "18.15.0",
    typescript: "5.0.3",
    java: "15.0.2",
    csharp: "6.12.0",
    bash: "5.2.0",
    php: "8.2.3",
    python: "3.10.0",
    cpp: "10.2.0",
    c: "10.2.0",
    dart: "2.19.6"
}

export const extensions = {
    js: "javascript",
    ts: "typescript",
    java: "java",
    cs: "csharp",
    sh: "bash",
    php: "php",
    py: "python",
    cpp: "cpp",
    c: "c",
    dart: "dart"
}

export const Code_Snipets = {
    javascript: `
function greet(name) {
	console.log("Hello, " + name + "!");
}

greet("Harsh");
`,
    typescript: `
type Params = {
	name: string;
}

function greet(data: Params) {
	console.log("Hello, " + data.name + "!");
}

greet({ name: "Harsh" });
`,
    python: `
def greet(name):
	print("Hello, " + name + "!")

greet("Harsh")
`,
    java: `
public class HelloWorld {
	public static void main(String[] args) {
		System.out.println("Hello World");
	}
}
`,
    csharp: `using System;

namespace HelloWorld
{
	class Hello { 
		static void Main(string[] args) {
			Console.WriteLine("Hello World in C#");
		}
	}
}
`,
    php: `<?php

$name = 'Harsh';
echo $name;
`,
    cpp: `
#include <iostream>
using namespace std;

int main()
{
	cout << "Hello World!!";

	return 0;
}`,
    c: `
#include <stdio.h>

int main() {
	printf("Hello World!!");
	return 0;
}
`,
    dart: `
void main() {
	print("Hello World!!");
}
`,
    bash: `
echo "Hello World"
`,
}
